<script>
  const email = document.getElementById("email");
  const notifyBtn = document.querySelector(".notify-btn");
  var ajaxurl = "<?php echo admin_url('admin-ajax.php'); ?>";
  const thankYou = `
        <h2>Thanks for contacting us! We will be in touch with you shortly.</h2>
    `;
  notifyBtn.addEventListener("click", () => {
    if (validateFn(email)) {
      loader("notify-btn", true, "Register");
      $.ajax({
        url: ajaxurl,
        type: "POST",
        data: {
          action: "mp_gl_save_new_email",
          email: email.value,
        },
        success: function (response) {
          console.log(response);
          if (response === "done") {
            loader("notify-btn", false, "Thank you");
            document.querySelector(".input-text-container").innerHTML =
              thankYou;
            notifyBtn.remove();
          }
        },
      });
    }
  });
</script>
